const styles = theme => ({
    titlePaper: {
        margin: theme.spacing(4,0,5,0),
        width: '45vw',
    },
    title: {
        margin: theme.spacing(2),
        width: '40vw',
    },
    saveButton: {
        flexGrow: "1",
        marginLeft: "2vw",
    },
});

export default styles;
